The approach to solve this problem by following the steps below:

1.) We would be checking the variable for negative values.
2.) Then, we calculate the absolute value of the current element.
3.) Then, we would evaluate the 'n'th element to be negative if the absolute value of the current element is positive.
4.) If the absolute value of the current element is negative, this would definitely mean that we have seen this value before.

Python solution is written below:

    def find_duplicate(nums):
        for i in range(len(nums)):
            if nums[abs(nums[i])] >= 0:
                nums[abs(nums[i])] = -nums[abs(nums[i])]
            else:
                return abs(nums[i])
